import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Columns = createReactComponent("Columns", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "3",
  width: "18",
  height: "18",
  rx: "2",
  ry: "2",
  key: "1sylwi"
}], ["line", {
  x1: "12",
  y1: "3",
  x2: "12",
  y2: "21",
  key: "1cuoio"
}]]]);
export default Columns;
